static bool _Geometry_Merge(const std::string &name, const std::vector<std::shared_ptr<hg::Geometry>> &geos, const std::vector<hg::Matrix4> &mtxs, std::shared_ptr<hg::Geometry> &out) { 
	if (geos.size() != mtxs.size())
		return false;

	size_t count = geos.size();

	std::vector<hg::GeometryMergeEntry> entries(count);
	for (size_t i = 0; i < count; ++i)
		entries[i] = {geos[i], mtxs[i]};

	out = hg::GeometryMerge(name, entries);
	return true;
}


