static void _SimpleGraphicSceneOverlay_Lines(hg::SimpleGraphicSceneOverlay *overlay, const std::vector<hg::Vector3> &points, const std::vector<hg::Color> &colors) {
	if (points.size() != colors.size()) {
		hg::debug("Mismatch between the number of points and colors");
		return;
	}

	size_t count = points.size();

	for (size_t i = 1; i < count; ++i) {
		auto &p_a = points[i - 1], &p_b = points[i];
		auto &c_a = colors[i - 1], &c_b = colors[i];
		overlay->Line(p_a.x, p_a.y, p_a.z, p_b.x, p_b.y, p_b.z, c_a, c_b);
	}
}


static void _SimpleGraphicSceneOverlay_Quad(hg::SimpleGraphicSceneOverlay *overlay, float ax, float ay, float az, float bx, float by, float bz, float cx, float cy, float cz, float dx, float dy, float dz, const hg::Color &a_color, const hg::Color &b_color, const hg::Color &c_color, const hg::Color &d_color) {
	overlay->Quad(ax, ay, az, bx, by, bz, cx, cy, cz, dx, dy, dz, 0, 0, 1, 1, nullptr, a_color, b_color, c_color, d_color);
}


static void _SimpleGraphicSceneOverlay_Quads(hg::SimpleGraphicSceneOverlay *overlay, const std::vector<hg::Matrix4> &mats, const float &width, const float &height, std::shared_ptr<hg::Texture> texture, const hg::Color &color) {
	for (auto &m : mats) {
		auto pos = m.GetTranslation();
		auto axis_x = m.GetX() * width / 2;
		auto axis_y = m.GetY() * height / 2;

		auto a = pos - axis_x - axis_y;
		auto b = pos - axis_x + axis_y;
		auto c = pos + axis_x + axis_y;
		auto d = pos + axis_x - axis_y;

		overlay->Quad(a.x, a.y, a.z,
			b.x, b.y, b.z,
			c.x, c.y, c.z,
			d.x, d.y, d.z,
			0, 0, 1, 1,
			texture,
			color, color, color, color);
	}
}


