static bool _Scene_RemoveAnimTake(hg::Scene *scene, size_t idx) {
	if (idx >= scene->anim_takes.size())
		return false;
	scene->anim_takes.erase(std::begin(scene->anim_takes) + idx);
	return true;
}
static void _Scene_RemoveAnimTake(hg::Scene *scene, const std::string &name) {
	scene->anim_takes.erase(std::remove_if(std::begin(scene->anim_takes), std::end(scene->anim_takes), [&](const std::shared_ptr<hg::AnimTake> &take) { return take->name == name; }), std::end(scene->anim_takes));
}
static void _Scene_RemoveAnimTake(hg::Scene *scene, const std::shared_ptr<hg::AnimTake> &take) {
	scene->anim_takes.erase(std::remove_if(std::begin(scene->anim_takes), std::end(scene->anim_takes), [&](const std::shared_ptr<hg::AnimTake> &take_) { return take_ == take; }), std::end(scene->anim_takes));
}


