static bool _Plus_RenderInit(hg::Plus *plus, int width, int height, int aa = 1, hg::Window::Visibility vis = hg::Window::Windowed, bool debug = false) { return plus->RenderInit(width, height, {}, aa, vis, debug); }


static void _Plus_Lines2D(hg::Plus *plus, const std::vector<hg::tVector2<float>> &points, const std::vector<hg::Color> &colors) {
	if (points.size() != colors.size()) {
		hg::debug("Mismatch between the number of points and colors");
		return;
	}

	size_t count = points.size();

	for (size_t i = 1; i < count; ++i) {
		auto &p_a = points[i - 1], &p_b = points[i];
		auto &c_a = colors[i - 1], &c_b = colors[i];
		plus->Line2D(p_a.x, p_a.y, p_b.x, p_b.y, c_a, c_b);
	}
}


static void _Plus_Quads2D(hg::Plus *plus, const std::vector<hg::tVector2<float>> &points, const float &size, const hg::Color &color, std::shared_ptr<hg::Texture> texture) {
	for (auto &p : points)
		plus->Quad2D(p.x - size, p.y - size, p.x - size, p.y + size, p.x + size, p.y + size, p.x + size, p.y - size, color, color, color, color, texture);
}


static hg::Plus &GetPlus() { return hg::g_plus.get(); }
